demo.repl.help:
Mga available na utos:
  @show              ─ ipakita ang huling buod ng adaptive card
  @json              ─ ilabas ang raw na JSON value na natanggap mula sa flow
  @back              ─ ibalik sa nakaraang na-block na card/inputs
  @input <k>=<v>     ─ itakda o i-override ang input field
  @click <action_id> ─ isumite ang card gamit ang ibinigay na action
  @help              ─ i-print ang help text na ito
  @quit              ─ lumabas sa REPL
